use std::collections::HashSet;

pub fn solve() {
    let mut result = 0;
    for (i, _) in get_input().chars().enumerate() {
        let neighbors: Vec<char> = get_input().chars().skip(i).take(14).collect();
        let set: HashSet<char> = HashSet::from_iter(neighbors.iter().cloned());
        if set.len() == 14 {
            result = i + set.len();
            break;
        }
    }
    println!("result: {:?}", result);
}

fn get_input() -> String {
    return String::from("
");
}
